import { useEffect, useState } from "react";
import axios from "axios";

const Play = ({ token }) => {
    const [ userData, setUserData ] = useState();

    useEffect(() => {
        axios.post('http://localhost:5000/accounts/me', {
            token: token,
        }).then(response => {
            console.log(response.data);
            setUserData(response.data);
        })
    }, [])

    return(
        <div>
            <h1>
                {userData.usename}
            </h1>
        </div>
    );
}

export default Play;
